import React from "react";
import '../App.css'
import { Link } from "react-router-dom";
import shareIcon from '../Images/shareIcon.png'
import insta from '../Images/icons8-instagram-50.png'
import JSZip from 'jszip';
import ProductImg from '../Images/Black Pearl.png'

const FreeFiles1 = [
  'https://dropment.online/Free_Instagram_theme_page_bundle_no1.zip'
];

const FreeFiles2 = [
  'https://dropment.online/Free_Instagram_theme_page_bundle_no2.zip'
];

const FreeFiles3 = [
  'https://dropment.online/Free_Instagram_theme_page_bundle_no3.zip'
];

const Product1 = () => {

  const handleShare = async () => {
    const siteURL = 'https://dropment.online/Black-Pearl'; // URL of dropment.online
  
    if (navigator.share) {
      try {
        await navigator.share({
          title: 'Check out Dropment!',
          text: `Discover cool motivational clips and download them for free to grow your Instagram page at Dropment.`,
          url: siteURL
        });
      } catch (error) {
        console.error('Error sharing:', error);
      }
    } else {
      // Fallback for browsers that don't support Web Share API
      const shareText = `Check out Dropment: Discover cool motivational clips and download them for free to grow your Instagram page at ${siteURL}`;
      const shareURL = `whatsapp://send?text=${encodeURIComponent(shareText)}`;
      window.location.href = shareURL;
    }
  };

  const downloadFile = (url) => {
    const fileName = url.split('/').pop();
    const aTag = document.createElement('a');
    aTag.href = url;
    aTag.setAttribute('download', fileName);
    document.body.appendChild(aTag);
    aTag.click();
    aTag.remove();
  }

  return (
    <div className="main-div-products-page">
      <div className="header_products_page">
        <Link to='/'>
          <button>&#9664;</button>
        </Link>
        <h2>Black Pearl</h2>
        <div className="icons">
          <img src={shareIcon} alt="Share icon" onClick={handleShare} />
          <img src={insta} alt="Instagram icon" onClick={() => downloadFile(FreeFiles1[0])} />
        </div>
      </div>
      <div className="product-section">
      <div className="product-image">
        <img src={ProductImg} alt="Product" />
      </div>
      <div className="product-details">
        <h2>Black Pearl</h2>
        <p className="price">$12</p>
        <p className="discounted-price">$0.00</p>
        <button className="buy-btn">Buy Now</button>
      </div>
    </div>
    <div className="description-section">
        <h3>Product Description</h3>
        <p>
          Here goes the overview of what the product is and what problem it solves or what benefit it offers to the users.
        </p>

        <h4>What's Included:</h4>
        <ul>
          <li>50+ clips</li>
          <li>Old money Clips</li>
          <li>Car Clips</li>
          <li>Yatch Clips</li>
          <li>Airplane Clips</li>
          <li>Party Clips</li>
          <li>Girls s</li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>
        <h4>Installation Instructions:</h4>
        <p>
          Provide step-by-step instructions for installing and setting up the product.
        </p>

        <h4>Usage Guide:</h4>
        <p>
          Explain how to use the product effectively, including any tips or best practices.
        </p>

        <h4>Support & Contact:</h4>
        <p>
          Provide information on how customers can contact support for assistance or inquiries.
        </p>

        <h4>Terms & Conditions:</h4>
        <p>
          Outline the terms of use, refund policy, license agreement, or any other relevant terms and conditions.
        </p>
      </div>
    </div>
  );
};

export default Product1;
